import Header from './content/HeaderSection'
import Body from './content/BodyContent';
import { Box } from '@mui/material';

const inicio = () =>{
    return(
        <>
            <Box flexDirection="column" justifyContent="center" alignItems="center" sx={{maxWidth:"1500px"}}>
                <Header></Header>
                <Body></Body>
            </Box>
        </>
    );
}

export default inicio;
